###########################################################################################
# Usage:                                                                                  #
# ./SVNtoDIR   http://EXAMPLE(CHANGEME).com/DIR/.svn/entries OUTPUTdirectory              #
#                                                                                         #
#       URL is the URL of the .svn/entries file                                           #
#       OUTPUTdirectory is an optional directory to save source code to                   #
#                                                                                         #
#   Flags That Will be implemented (eventually):                                          #
#       -t = Test file availability                                                       #
#           -The script could return a server response code in the HTML to identify pages #
#           that 404, 302, 200, etc.                                                      #
#   Other Stuff to Add:                                                                   #
#    Interesting Files List (*.config, *.ini, admin.*, password.*, etc.)                  #
#                                                                                         #
# Author: Karl Fosaaen (NetSPI)                                                           #
#   Twitter: @kfosaaen                                                                    #
#                                                                                         #
# Table Sorting JS - http://www.kryogenix.org/code/browser/sorttable/                     #
###########################################################################################

#Start by going up to the root DIR and find your SVN entries file, put it as the URL
$url = $args[0]

#Flag for Downloading .svn-base files
$DLFlag = 0

if ($args[1]){
	$OUTDIR = $args[1]
	$DLFlag = 1
	#Create a new DIR in folder
	$newOUTPUTDIR = "mkdir "+$OUTDIR+""
	Invoke-Expression $newOUTPUTDIR|out-null
}

#Initial working directory
$ORIGDIR = $(get-location)

#Removes SSL validation - Taken from http://pauljbrice.wordpress.com/2011/02/04/could-not-establish-trust-relationship/
$netAssembly = [Reflection.Assembly]::GetAssembly([System.Net.Configuration.SettingsSection])
IF($netAssembly) {
	$bindingFlags = [Reflection.BindingFlags] "Static,GetProperty,NonPublic"
	$settingsType = $netAssembly.GetType("System.Net.Configuration.SettingsSectionInternal")
	$instance = $settingsType.InvokeMember("Section", $bindingFlags, $null, $null, @())
	if($instance) {
	$bindingFlags = "NonPublic","Instance"
	$useUnsafeHeaderParsingField = $settingsType.GetField("useUnsafeHeaderParsing", $bindingFlags)
		if($useUnsafeHeaderParsingField) {
		$useUnsafeHeaderParsingField.SetValue($instance, $true)
		}
	}
}
[System.Net.ServicePointManager]::ServerCertificateValidationCallback = {$true}
#End SSL bypass code - Thanks Paul J Brice!

#Main Function
function parseEntries($entriesURL){

	#Splits the entriesURL into the DIR that it's looking at
	$PATHDIR =  $entriesURL.Split(“/”)[-3]
	$PATHDIR = $PATHDIR -replace " ",""
	
	#Current DIR
	$CleanURL = $entriesURL -replace ".svn/entries",""
	#URL for .svn folder
	$SVNURL = $entriesURL -replace "entries",""
	
	#Current working directory
	$CURRDIR = $(get-location)
	
	#Path for temp SVN entries file
	$path = ""+$CURRDIR+"\tempSVN_"+$PATHDIR+".txt"
		
	#Downloads the SVN entries file
	$client = new-object System.Net.WebClient
	try {
		$client.DownloadFile( $entriesURL, $path )
		write-host "Found Additional Entries File`nDownloaded:`t"$entriesURL"`n"
	}
	catch [Exception] {
		if($_.Exception.Message -eq "The underlying connection was closed: Could not establish trust relationship for the SSL/TLS secure channel."){write-host "`nHTTPS certificate is not trusted, try adding it to your trusts in IE.`n"}
		elseif($_.Exception.Message -eq "The remote server returned an error: (404) Not Found."){
			write-host $_.Exception.Message;
			$garbage = " "
			$garbage | out-file -encoding ASCII $path
		}
		else{
		}
	}
		
	#This keeps track of the previous line - Important for file parsing	
	$previousLine = ""
	
	#Create a new DIR in folder
	$newDIR = "mkdir "+$PATHDIR+""
	Invoke-Expression $newDIR|out-null
	#Move into that new DIR
	$moveDIR = "cd "+$PATHDIR+""
	Invoke-Expression $moveDIR

	#Path for Output file
	$outfile = $PATHDIR+".html"
		
	#Add check for root dir (parent DIR link) - This is a todo item
	$HTMLBase = "<HTML><head><H1>Index of /"+$PATHDIR+'/</H1><script src="file://'+$ORIGDIR+'/sorttable.js"></script><head>'+$netspiImage+'<br><table class="sortable"><thead><tr><th>Icon</th><th>Name</th><th>Type</th></tr></thead><tbody>'
	$HTMLBase | out-file -encoding ASCII -append $outfile

	
	Get-Content $path | Foreach-Object {
		#Parse until you hit a DIR or a FILE
		if(($_ -eq "DIR") -and ($previousLine)){
			$recurseDIR = $CleanURL+$previousLine+"/.svn/entries"
			
			#HTML Link for the DIR (base64 garbage is the icon)
			$DIRLink = '<tr><td valign="top"><img alt="" src="data:image/gif;base64," /></td><td><a href="'+$previousLine+"/"+$previousLine+'.html">'+$previousLine+"</a></td><td>Directory</td></tr>"
			$DIRLink | out-file -encoding ASCII -append $outfile

			#RECURSE!
			parseEntries($recurseDIR)
		}
		elseif($_ -eq "FILE"){
			#HTML Link for the FILE (base64 garbage is the icon)
			$FILELink = '<tr><td valign="top"><img alt="" src="data:image/gif;base64," /></td><td><a href="'+$CleanURL+$previousLine+'">'+$previousLine+"</a></td><td>File</td></tr>"
			#HTML Link for the .svn-base of the FILE; the source (base64 garbage is the icon)
			$FILELink2 = '<tr><td valign="top"><img alt="" src="data:image/gif;base64," /></td><td><a href="'+$SVNURL+"text-base/"+$previousLine+'.svn-base">'+$previousLine+".svn-base</a></td><td>Source File</td></tr>"
			$FILELink | out-file -encoding ASCII -append $outfile
			$FILELink2 | out-file -encoding ASCII -append $outfile
		
			#Download of .svn-base method
			if($DLFlag -eq 1){
				$path2 = ""+$ORIGDIR+"\"+$OUTDIR+"\"+$previousLine+".svn-base"
				$entriesURL2 = ""+$SVNURL+"text-base/"+$previousLine+".svn-base"
				
				try {
					$client.DownloadFile( $entriesURL2, $path2 )
					write-host ".svn-base File`nDownloaded:`t"$entriesURL2"`n"
					}
				catch [Exception] {
					if($_.Exception.Message -eq "The underlying connection was closed: Could not establish trust relationship for the SSL/TLS secure channel.")
					{write-host "`nHTTPS certificate is not trusted, try adding it to your trusts in IE.`n"}
					elseif($_.Exception.Message -eq "The remote server returned an error: (404) Not Found."){write-host $_.Exception.Message;}
					}
			}
		}
		else{$previousLine = $_}
	}
	#write final line of HTML to out file
	$HTMLFinal = "</tbody></table></HTML>"
	$HTMLFinal | out-file -encoding ASCII -append $outfile
	
	#Back out of new DIR
	Invoke-Expression "cd .."
	
	#deletes $path temp file
	$delEXP = "del "+$path+""
	Invoke-Expression $delEXP
}	

#Some NetSPI Flair
$netspiImage = '<img alt="" src="data:image/gif;base64," width=500/>'

parseEntries($url)